        Inputs.var_margin.Value = UDMethods.ConvertToDecimal(PCLookUp.DataLookup("IQMPO_MarginValue", "Margin%", "Post"));

        /* Returns the total BOM FIFO Material Cost */
        Inputs.var_totalmtlcost.Value = Inputs.var_fifo1.Value + Inputs.var_fifo2.Value + Inputs.var_fifo3.Value + Inputs.var_fifo4.Value + Inputs.var_fifo5.Value + Inputs.var_fifo6.Value + Inputs.var_fifo7.Value + Inputs.var_fifo8.Value + Inputs.var_fifo9.Value + Inputs.var_fifo10.Value + Inputs.var_fifo11.Value + Inputs.var_fifo12.Value + Inputs.var_fifo13.Value + Inputs.var_fifo14.Value + Inputs.var_fifo15.Value + Inputs.var_fifo16.Value;

		 /* Verifies that each part in the BOM has a FIFO Cost */

		/*
		        if ((Inputs.var_part1.Value != "") && (Inputs.var_fifo1.Value == 0))
		        {

		            MessageBox.Show("One of the parts in the BOM has a FIFO cost of Zero. This may impact on the final selling price.");

		        }
		*/



        /* ****************************************************************************************************************************************************************************************** */

        /* Access to costing data is to be restricted to a control list of user id's */

        /* Get the current User ID -- Will be used to determine access to costing data */
        Inputs.var_userid.Value = Context.UserID; // ?? GetCurrentUserID();

        /* Checks if the user id is on the access list csv and returns the True or False Flag */
        Inputs.var_fifoaccess.Value = PCLookUp.DataLookup("CostPermissionsList", "access_allow", Inputs.var_userid.Value);

        if ((Inputs.var_fifoaccess.Value == "") || (Inputs.var_fifoaccess.Value == "False")) { Inputs.var_fifoaccess.Value = "False"; }

        /* Determines if cost data is visible */
        if (Inputs.var_fifoaccess.Value == "False")
        {
	        Inputs.var_fifo1.Invisible = true;
	        Inputs.var_fifo2.Invisible = true;
	        Inputs.var_fifo3.Invisible = true;
	        Inputs.var_fifo4.Invisible = true;
	        Inputs.var_fifo5.Invisible = true;
	        Inputs.var_fifo6.Invisible = true;
	        Inputs.var_fifo7.Invisible = true;
	        Inputs.var_fifo8.Invisible = true;
	        Inputs.var_fifo9.Invisible = true;
	        Inputs.var_fifo10.Invisible = true;
	        Inputs.var_fifo11.Invisible = true;
	        Inputs.var_fifo12.Invisible = true;
	        Inputs.var_fifo13.Invisible = true;
	        Inputs.var_fifo14.Invisible = true;
	        Inputs.var_fifo15.Invisible = true;
	        Inputs.var_fifo16.Invisible = true;
	        Inputs.TEXT18.Invisible = true;
	        Inputs.TEXT20.Invisible = true;
	        Inputs.TEXT24.Invisible = true;
	        Inputs.var_margin.Invisible = true;
	        Inputs.var_totalmtlcost.Invisible = true;
	        Inputs.TEXT19.Invisible = true;
	        Inputs.var_currencyexchange.Invisible = true;
        }

        if (Inputs.var_fifoaccess.Value == "True")
        {
	        Inputs.var_fifo1.Invisible = false;
	        Inputs.var_fifo2.Invisible = false;
	        Inputs.var_fifo3.Invisible = false;
	        Inputs.var_fifo4.Invisible = false;
	        Inputs.var_fifo5.Invisible = false;
	        Inputs.var_fifo6.Invisible = false;
	        Inputs.var_fifo7.Invisible = false;
	        Inputs.var_fifo8.Invisible = false;
	        Inputs.var_fifo9.Invisible = false;
	        Inputs.var_fifo10.Invisible = false;
	        Inputs.var_fifo11.Invisible = false;
	        Inputs.var_fifo12.Invisible = false;
	        Inputs.var_fifo13.Invisible = false;
	        Inputs.var_fifo14.Invisible = false;
	        Inputs.var_fifo15.Invisible = false;
	        Inputs.var_fifo16.Invisible = false;
	        Inputs.TEXT18.Invisible = false;
	        Inputs.TEXT20.Invisible = false;
	        Inputs.TEXT24.Invisible = false;
	        Inputs.var_margin.Invisible = false;
	        Inputs.var_totalmtlcost.Invisible = false;
	        Inputs.TEXT19.Invisible = false;
	        Inputs.var_currencyexchange.Invisible = false;
        }


        /* Currency Conversion */
				Inputs.var_currencyexchange.Value = "GBP-" + Inputs.var_currency.Value;

        /* Returns the exchange rate from the csv */
				Inputs.var_exchangerate.Value = UDMethods.ConvertToDecimal(PCLookUp.DataLookup("SalesCurrencyRates", "rate_conversion", Inputs.var_currencyexchange.Value));

        /* Returns the exchange rate multiplier type from the csv */
        string multipliertype = "";
        multipliertype = "";

        multipliertype = PCLookUp.DataLookup("SalesCurrencyRates", "adjustment_type", Inputs.var_currencyexchange.Value);

        if ((multipliertype == "Multiply") && (Inputs.chk_manualpriceentry.Value == false) && (Inputs.var_costingmethod.Value == "FIFO"))
        {
            Inputs.var_listpricetotal.Value = (Inputs.var_totalmtlcost.Value / (Inputs.var_margin.Value / 100)) * Inputs.var_exchangerate.Value;
        }

        if ((Inputs.var_part1.Value != "") && (Inputs.var_fifo1.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part2.Value != "") && (Inputs.var_fifo2.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part3.Value != "") && (Inputs.var_fifo3.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part4.Value != "") && (Inputs.var_fifo4.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part5.Value != "") && (Inputs.var_fifo5.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part6.Value != "") && (Inputs.var_fifo6.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part7.Value != "") && (Inputs.var_fifo7.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part8.Value != "") && (Inputs.var_fifo8.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part9.Value != "") && (Inputs.var_fifo9.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part10.Value != "") && (Inputs.var_fifo10.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part11.Value != "") && (Inputs.var_fifo11.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part12.Value != "") && (Inputs.var_fifo12.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part13.Value != "") && (Inputs.var_fifo13.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part14.Value != "") && (Inputs.var_fifo14.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part15.Value != "") && (Inputs.var_fifo15.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }
        if ((Inputs.var_part16.Value != "") && (Inputs.var_fifo16.Value == 0)) { Inputs.var_fifoiszero.Value = "True"; }

        /* Costing Calc if Fifo cost is not bool available_for all parts and the costing method is set as FIFO in the CSV */
        if ((Inputs.var_fifoiszero.Value == "True") && (Inputs.var_costingmethod.Value == "FIFO") && (Inputs.chk_manualpriceentry.Value == false))
        {
					Inputs.chr_manualprice.Invisible = false;
					//  ERROR: Inputs.TEXT24.Invisible = false; ??
					//  ERROR: Inputs.TEXT21.Invisible = false; ??
					Inputs.chr_manualprice.Value = true;

					Inputs.chr_manualprice.Label = "Calc Using List Price Reserve:";

					if (multipliertype == "Multiply")
					{
							Inputs.var_listpricetotal.Value = (((Inputs.var_listpricebase.Value + Inputs.var_listpriceinfills.Value + Inputs.var_listpricepost.Value) / (Inputs.var_margin.Value / 100)) * Inputs.var_exchangerate.Value) * Inputs.var_listpricemultiplier.Value;
					}

					Inputs.TEXT21.Label = "Note. A Component in the BOM has a Zero FIFO Cost..";
        }

        /* Costing Calc if Fifo cost bool available_for all parts and the costing method is set as FIFO in the CSV */
        if ((Inputs.var_fifoiszero.Value == "") && (Inputs.var_costingmethod.Value == "FIFO") && (Inputs.chk_manualpriceentry.Value == false))
        {
						Inputs.chr_manualprice.Invisible = false;
						//  ERROR: Inputs.TEXT24.Invisible = false; ??
						//  ERROR: Inputs.TEXT20.Invisible = true; ??
						Inputs.chr_manualprice.Value = true;

						Inputs.chr_manualprice.Label = "Calc Using FIFO Material Cost:";
						if (multipliertype == "Multiply")
						{
								Inputs.var_listpricetotal.Value = (((Inputs.var_listpricebase.Value + Inputs.var_listpriceinfills.Value + Inputs.var_listpricepost.Value) / (Inputs.var_margin.Value / 100)) * Inputs.var_exchangerate.Value) * Inputs.var_listpricemultiplier.Value;
						}
        }

        /* Costing Calc if costing method is set as LIST in the CSV */
        if ((Inputs.var_costingmethod.Value == "LIST") && (Inputs.var_listpricemissing.Value != "True") && (Inputs.chk_manualpriceentry.Value == false))
        {
						Inputs.chr_manualprice.Invisible = false;
						//  ERROR: Inputs.TEXT20.Invisible = true;
						//  ERROR: Inputs.TEXT24.Invisible = true;
						Inputs.chr_manualprice.Value = true;

						Inputs.chr_manualprice.Label = "Calc Using List Price Reserve:";

						if (multipliertype == "Multiply")
						{
								Inputs.var_listpricetotal.Value = (((Inputs.var_listpricebase.Value + Inputs.var_listpriceinfills.Value + Inputs.var_listpricepost.Value) / (Inputs.var_margin.Value / 100)) * Inputs.var_exchangerate.Value) * Inputs.var_listpricemultiplier.Value;
						}
        }

				Inputs.chk_allowzero.Value = false;

if ((Inputs.var_listpricetotal.Value == 0) && ( Inputs.chk_allowzero.Value == false)) {

  MessageBox.Show("The unit price is currently set as Zero but the Allow Zero Price is set as False. If this is the desired value please tick the Allow Zero Price checkbox before saving the configuration..", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
PageLeaveFunctions.SetNextInputPage(5);
Args.Cancel = true;

}
